import React from "react";
import { Route, Switch, useHistory } from "react-router-dom";
import Sidebar from "../Sidebar";
import AddProduct from "./products/AddProduct";
import AddCategory from "./products/AddCategory";
import ListProducts from "./products/ListProducts";

const Dashboard = () => {
  const history = useHistory();
  return (
    <div className="block">
      <div className="mt-28">
        <Sidebar />
      </div>
      <div className="block block w-48 mt-14">
        <h2 className="text-center font-bold text-2xl py-2">Dashboard</h2>
      </div>
      <div className="w-full shadow-md mb-2">
        <i
          className="fa fa-angle-left text-3xl text-green-600 m-1 font-bold cursor-pointer px-2 py-1"
          onClick={() => history.goBack()}
          title="go back"
        ></i>
      </div>
      <div className="block w-full">
        <Switch>
          <Route exact path="/dashborad/product" component={AddProduct} />
          <Route exact path="/dashborad/products" component={ListProducts} />
          <Route
            exact
            path="/dashborad/category"
            component={AddCategory}
          />
          <Route exact path="/dashborad/categories" component={Orders} />
          <Route exact path="/dashborad/wishlist" component={WishList} />
        </Switch>
      </div>
    </div>
  );
};

export default Dashboard;
